import React from "react";

import ExpenseItem from "./ExpenseItem";

const ExpensesList = props => {

    let expenseItemData = <p>No data Found!!!</p>;

    if (filterExpenseData.length > 0) {
        expenseItemData = filterExpenseData.map(items => {
            return (
                <ExpenseItem
                    key={items.id}
                    title={items.title}
                    amount={items.amount}
                    date={items.date}
                />);
        })
    }
}

export default ExpensesList;
